d.com/coupon/Hotel2/1.jpg',0,5),(22,'Royal桔子酒店(上海威宁路地铁站店)','中国，上海，长宁区，威宁路428号',NULL,'上海',NULL,'长宁区',30.4000,122.1200,3020,'酒店地处长宁区天山路和威宁路路口，紧邻地铁2号线威宁路站4号出；酒店临近虹桥国家会展中心、世贸会展中心、国际会展中心、上海跨国采购会展中心，周围购物中心、餐饮店铺汇聚。 酒店由国外著名设计师设计，装潢雅致，拥有各类温馨、舒适的客房。房内设24小时热水、独立卫浴、电话等。同时，店内配备烘干洗衣机、微波炉等生活设施，为宾客提供便捷的休憩地，适合商务出行，情侣出行，亲子出游，休闲度假','17245682134',540,4,4.9,5.0,5.0,5.0,5.0,'https://hotel-1313882515.cos.ap-guangzhou.myqcloud.com/coupon/Hotel2/2.jpg',0,6),(23,'Royal栖梦民宿(上海新月店)','中国，上海，浦东新区，川沙新镇栏杆村潘家宅12号',NULL,'上海',NULL,'浦东新区',30.4000,122.1200,5000,'追求自然与平衡的侘寂美学，由著名设计团队操刀，梦幻与少女、极简与科技、浪漫与童真交相辉映，每处细节都透露着高级感，每个场景都秒出大片。民宿庭院特有的超大月亮，守护每个人的童心。','15769824310',230,5,4.8,5.0,5.0,5.0,5.0,'https://hotel-1313882515.cos.ap-guangzhou.myqcloud.com/coupon/Hotel2/3.jpg',0,6),(24,'Royal美朋·轻奢酒店(上海光大会展中心火车南站店)','中国，上海，徐汇区，冠生园路231号2幢',NULL,'上海',NULL,'徐汇区',30.4000,122.1200,5413,'酒店位于上海市徐汇区冠生园路231号2幢。美朋·轻奢酒店（上海光大会展中心冠生园路店）以【东方之美】精神作为设计理念，客房全部选用零压（梦百合）床垫，舒缓疲惫的身躯，为来沪差旅的您提供优质舒适的睡眠；天然沐浴用品，使您愉悦、安心、舒缓压力；精选用具呈现东方之美，让东方的生活方式在旅途延续，为旅途带来一天的能量；更提供小水吧、高速宽带WiFi为您的提供便利。美朋·轻奢酒店（上海光大会展中心冠生园路店）还有原创特色下午茶、自助餐、洗衣房、健身房等设施服务给您的出行带来不一样的体验。美朋·轻奢酒店（上海光大会展中心冠生园路店）临近上海南站，步行15分钟左右；地铁站漕宝路，步行20分钟；上海虹桥机场，打车35分钟。酒店临近光大会展中心、日月光购物中心、万商生活广场。周边美食繁多，口留香老上海馄饨、古贤居、盒马生鲜奥莱店等美食应有尽有。酒店全体员工期待您下榻本酒店，竭诚为您提供温馨舒适的服务。','17456226659',564,3,5.0,5.0,5.0,5.0,5.0,'https://hotel-1313882515.cos.ap-guangzhou.myqcloud.com/coupon/Hotel2/4.jpg',0,6),(25,'Royal美豪丽致酒店(上海徐家汇衡山路旗舰店)','中国，上海，徐汇区，建国西路691号',NULL,'上海',NULL,'徐汇区',NULL,NULL,5321,'中国，上海，徐汇区，建国西路691号','15000059989',518,2,4.6,5.0,5.0,5.0,5.0,'https://hotel-1313882515.cos.ap-guangzhou.myqcloud.com/coupon/Hotel2/5.jpg',0,6),(26,'Royal上海陆家嘴东方明珠CitiGO酒店','中国，上海，浦东新区，商城路357号(浦城路口)',NULL,'上海',NULL,'徐汇区',NULL,NULL,1245,'酒店位于浦东陆家嘴核心位置，紧邻陆家嘴金融中心、东方明珠、上海中心大厦、金茂等知名地标，周边配套齐全，交通便利。步行约5分钟即可到达地铁9号线商城路站、八佰伴购物中心，步行约8分钟可达地铁2号线东昌路站。\nCitiGO是华住集团旗下中高档酒店品牌，名字取自英文“City，Go!”,表述了品牌年轻、自由、随性的风格，以及立足城市社区。',NULL,1024,5,4.7,5.0,5.0,5.0,5.0,'https://hotel-1313882515.cos.ap-guangzhou.myqcloud.com/coupon/Hotel2/6.jpg',0,6),(27,'Royal阳光精品公寓(花都融创文旅城狮岭店)','中国，广东，广州，花都区，狮岭镇阳光南路13号',NULL,'广州',NULL,'花都区',NULL,NULL,7812,'坐落于花都融创文旅城周边，不论您是商务出差还是休闲旅游Sunshine阳光精品公寓都是理想的下榻之处。\n酒店休闲区提供了各类设施，您可以在这里舒缓身心压力','15723694560',213,4,4.2,5.0,5.0,5.0,5.0,'https://hotel-1313882515.cos.ap-guangzhou.myqcloud.com/coupon/Hotel2/7.jpg',0,5),(28,'Royal创时代酒店(广州天河智慧城地铁站店)','中国，广东，广州，天河区，华观路万科广场A4栋5楼',NULL,'广州',NULL,'花都区',NULL,NULL,4587,'酒店位于广州市天河区天河智慧城万科商业广场A4栋，酒店房间拥有独立阳台，配备洗衣机、冰箱、热水壶、电吹风、网络电视、无限Wifi。酒店秉持让宾客家人们住得“舒心、温馨、暖心”的服务理念，坚持为客户带来高品质体验。','15856478912',5674,5,3.8,5.0,5.0,5.0,5.0,'https://hotel-1313882515.cos.ap-guangzhou.myqcloud.com/coupon/Hotel2/8.jpg',0,6),(29,'中国，广东，广州，天河区，华观路万科广场A4栋5楼','中国，广东，广州，白云区，矮岗村矮岗北街26号',NULL,'广州',NULL,'白云区',NULL,NULL,NULL,'酒店位于空港经济区，距广州融创乐园约9公里，临近高增、人和地铁站，地理位置优越，并有豪华车24小时接驳机场（详情请咨询商家），出行便利。\n这是一家让您真正心动会记住的轻奢型酒店，秉持让宾客家人们住的“舒心、温馨、暖心”的服务理念，坚持为客户带来高品质体验。酒店环境生态、装修时尚高雅，配套设施齐全，服务专业周到。',NULL,5647,3,4.5,5.0,5.0,5.0,5.0,'https://hotel-1313882515.cos.ap-guangzhou.myqcloud.com/coupon/Hotel2/9.jpg',0,6);
